const getCategorias = setState => {

    const _listaCategorias = [
        {
            'id' : 1,
            'descricao' : 'Monstanha'
        },
        {
            'id' : 2,
            'descricao' : 'Planície'
        },
        {
            'id' : 3,
            'descricao' : 'Ilha'
        }
    ]

    setState(_listaCategorias)
}

export default getCategorias
